import React, { useState, useEffect }  from 'react';
import axios from "axios";
const Home = () => {
    function getData() {
        axios({
          method: "GET",
          url:"/topTenMoviesNow",
        })
        .then((response) => {
          const res =response.data
          console.log(res)
        }).catch((error) => {
          if (error.response) {
            console.log(error.response)
            console.log(error.response.status)
            console.log(error.response.headers)
            }
        })}
    }
export default Home;
